private static GeoRect nextBoxInternal(double lat0, double lat1, double lon0, double lon1, boolean canCrossDateLine) {
  if (lat1 < lat0) {
    double x = lat0;
    lat0 = lat1;
    lat1 = x;
  }

  if (canCrossDateLine == false && lon1 < lon0) {
    double x = lon0;
    lon0 = lon1;
    lon1 = x;
  }

  return new GeoRect(lat0, lat1, lon0, lon1);
}

